import React, { useEffect, useContext } from 'react'
import noteContext from "../context/notes/noteContext";

const Welcome = () => {
  const context = useContext(noteContext);
  const {setSession} = context;
  //Added by me to increase security
  useEffect(() => {
    sessionStorage.removeItem("iNotebookAuthToken");
    setSession(null);
    // eslint-disable-next-line
  }, []);
  return (
    <div>
        <div className="d-flex align-items-center justify-content-center flex-column container my-5">
            <h1>Welcome to iNotebook</h1>
            <h2>Your Notes on Cloud</h2>
        </div>
      
    </div>
  )
}

export default Welcome
